CREATE TABLE IF NOT EXISTS employees (
    employee_id BIGINT PRIMARY KEY AUTO_INCREMENT,
    role VARCHAR(50),
    username VARCHAR(50),
    password VARCHAR(100),
    last_name VARCHAR(100),
    first_name VARCHAR(100),
    birthday DATE,
    address VARCHAR(600),
    phone_number VARCHAR(60),
    sss_no VARCHAR(60),
    philhealth_no VARCHAR(60),
    tin_no VARCHAR(60),
    pagibig_no VARCHAR(60),
    status VARCHAR(20),
    position VARCHAR(50),
    immediate_supervisor VARCHAR(50),
    basic_salary DECIMAL(10,2),
    rice_subsidy DECIMAL(10,2),
    phone_allowance DECIMAL(10,2),
    clothing_allowance DECIMAL(10,2),
    gross_semi_monthly_rate DECIMAL(10,2),
    hourly_rate DECIMAL(10,2)
) AUTO_INCREMENT=10000;

CREATE TABLE IF NOT EXISTS attendance (
    id BIGINT PRIMARY KEY AUTO_INCREMENT,
    name VARCHAR(100),
    date_of_attendance DATE,
    time_in VARCHAR(10),
    time_out VARCHAR(10),
    is_late BOOLEAN,
    is_absent BOOLEAN,
    employee_id BIGINT,
    FOREIGN KEY (employee_id) REFERENCES employees (employee_id)
);

CREATE TABLE IF NOT EXISTS users (
   username VARCHAR(100) NOT NULL,
   password VARCHAR(100) NOT NULL,
   enabled TINYINT(1) NOT NULL,
   PRIMARY KEY (username)
);

CREATE TABLE authorities (
    username VARCHAR(50) NOT NULL,
    authority VARCHAR(50) NOT NULL,
    CONSTRAINT authorities_pk PRIMARY KEY (username, authority),
    CONSTRAINT authorities_fk FOREIGN KEY (username) REFERENCES users (username)
);


